Legends of the Dark Knight is an ongoing weekly digital first comic. 

Two Gotham locals learn that even being a responsible member of society doesn't offer immunity to Batman's Rogues Gallery. But how does a brush with the Penguin bring them into Harvey Dent's orbit? &quot;The Beautiful Ugly&quot; part 2 of 3.

